import React, { Component } from 'react';
import logo from './logo.svg';
import './App.css';
import 'bootstrap';
import '../node_modules/bootstrap/dist/css/bootstrap.css';




class App extends Component {

  constructor(props){
    super(props);

    this.state = {dados:"Dados Iniciais"}

  }


  menssagem = () => {
     this.setState = {dados:"Novos Dados"}
  }

  render() {

    return (

      <div class="container">                 
             <div class="card">
            <ul class="list-group list-group-flush">
                 <li class="list-group-item">
                      <input type="text" name="entrada" class="input-texto" value={this.state.dados}/>    

                 </li> 
                 <li>
                    <button onClick={this.menssagem}>Testar</button>
                   </li>                   
            </ul>
          </div>  
      </div>     


    )
  }
}


